		<meta property="og:site_name" content="snake game" />
		<meta property="og:title" content="Snake Game" />
		<meta
			property="og:description"
			content="Snake is a video game genre where the player maneuvers a growing line that becomes a primary obstacle to itself. The concept originated in the 1976 two-player arcade game Blockade from Gremlin Industries, and the ease of implementation has led to hundreds of versions for many platforms."
		/>
		<meta
			property="og:image"
			itemprop="image"
			content="https://i.postimg.cc/PqgZ3Qmv/snakegame.png"
		/>
		<meta property="og:type" content="website" />
		<title>Snake Xenzia</title>

		<link
			rel="icon"

		/>

		<link
			href="https://fonts.googleapis.com/css2?family=Press+Start+2P&display=swap"
			rel="stylesheet"
		/>
		<!-- CSS only -->

			href="https://cdn.jsdelivr.net/npm/bootstrap@5.2.2/dist/css/bootstrap.min.css"
			rel="stylesheet"

			rel="stylesheet"

			crossorigin="anonymous"

			src="https://cdn.jsdelivr.net/npm/bootstrap@5.2.2/dist/js/bootstrap.bundle.min.js"

	<body>
		<main id="snake-world">
			<div class="left">
				<h4 class="mb-3">
					Snake <br />
					Xenzia
				</h4>
				<p>Score - <span class="score"></span></p>
				<p>High Score - <span class="high"></span></p>
				<input type="checkbox" id="proto" />&nbsp;
				<label for="proto">Prototype</label>
				<label class="d-block mt-2 mb-2">Speed</label>
				<select class="form-select" id="speed" name="speed">
					<option value="100" selected>Easy</option>
					<option value="70">Intermediate</option>
					<option value="40">Hard</option>
				</select>
				<p class="sound mt-3" id="music" style="cursor: pointer">
					<i
						style="font-size: 1.1rem !important"
						class="bi bi-volume-up-fill"
					></i>
					Music
				</p>
				<h6 class="mt-4 mb-3"><strong>Note</strong></h6>
				<p style="font-weight: 600">
					1) Press Space or <br />
					Double click the LMB <br />
					<i class="bi bi-mouse2-fill"></i> to pause the game
				</p>
				<p style="font-weight: 600">
					2) Use Arrow Keys <i class="bi bi-arrows-move"></i> <br />
					to move.
				</p>
				<p style="font-weight: 600">
					3) For touch enabled <br />
					devices use gestures <br />
					to move.
				</p>
